import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function App() {


    return (
        <Router>
            <Navbar />
            <Switch>
                <Route exact path="/">
                    <h2>Mesbaul alom</h2>
                </Route>

            </Switch>
        </Router>
    );
}

export default App;
